INSERT INTO `faqs` VALUES (1,'Thời gian giao hàng là bao lâu?','Thời gian giao hàng từ 3 đến 7 ngày làm việc, tùy thuộc vào địa điểm của bạn.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(2,'Tôi có thể thay đổi địa chỉ giao hàng không?','Có, bạn có thể thay đổi địa chỉ giao hàng trước khi đơn hàng được xử lý. Hãy liên hệ với chúng tôi để được hỗ trợ.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(3,'Sản phẩm có được bảo hành không?','Có, tất cả các sản phẩm đều được bảo hành theo chính sách bảo hành của chúng tôi.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(4,'Tôi có thể trả lại sản phẩm nếu không hài lòng?','Có, bạn có thể trả lại sản phẩm trong vòng 30 ngày kể từ ngày nhận hàng nếu sản phẩm còn mới và chưa sử dụng.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(5,'Có chương trình khuyến mãi nào không?','Chúng tôi thường xuyên có các chương trình khuyến mãi. Bạn hãy theo dõi trang web hoặc đăng ký nhận bản tin để nhận thông tin mới nhất.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(6,'Có thể thanh toán bằng hình thức nào?','Chúng tôi chấp nhận nhiều hình thức thanh toán, bao gồm thẻ tín dụng, thẻ ghi nợ, và chuyển khoản ngân hàng.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(7,'Sản phẩm có thể tùy chỉnh không?','Có, một số sản phẩm của chúng tôi có thể được tùy chỉnh theo yêu cầu của khách hàng. Vui lòng liên hệ với chúng tôi để biết thêm chi tiết.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(8,'Tôi có thể nhận được hỗ trợ lắp đặt không?','Chúng tôi cung cấp dịch vụ hỗ trợ lắp đặt cho một số sản phẩm. Bạn có thể chọn dịch vụ này khi đặt hàng.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(9,'Chính sách bảo mật thông tin cá nhân của bạn như thế nào?','Chúng tôi cam kết bảo mật thông tin cá nhân của khách hàng và chỉ sử dụng thông tin này cho mục đích xử lý đơn hàng và cung cấp dịch vụ.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(10,'Tôi có thể liên hệ với bộ phận hỗ trợ khách hàng bằng cách nào?','Bạn có thể liên hệ với bộ phận hỗ trợ khách hàng qua số điện thoại, email, hoặc chat trực tiếp trên website. Chúng tôi luôn sẵn sàng hỗ trợ bạn.','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL);
