INSERT INTO `policies` VALUES (1,'Chính sách bảo hành','{\"warranty_policy\": {\"process\": [\"Liên hệ bộ phận chăm sóc khách hàng qua hotline hoặc email\", \"Hướng dẫn gửi sản phẩm hoặc kiểm tra tận nơi\", \"Thời gian xử lý bảo hành trong vòng 7-15 ngày làm việc\", \"Trả sản phẩm và cung cấp thông tin sau bảo hành\"], \"conditions\": {\"eligible\": [\"Sản phẩm bị lỗi kỹ thuật do nhà sản xuất\", \"Sản phẩm không có dấu hiệu sửa chữa hoặc can thiệp từ bên thứ ba\", \"Cung cấp phiếu bảo hành và hóa đơn mua hàng\"], \"ineligible\": [\"Hư hỏng do sử dụng sai hướng dẫn\", \"Hư hỏng do tác động môi trường bên ngoài (nước, nhiệt độ cao)\", \"Thiên tai, hỏa hoạn, lũ lụt\"]}, \"warranty_period\": \"12 tháng\"}}','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(2,'Chính sách đổi trả sản phẩm','{\"return_policy\": {\"process\": [\"Liên hệ bộ phận chăm sóc khách hàng để yêu cầu đổi trả\", \"Xác nhận điều kiện sản phẩm và chuẩn bị hồ sơ cần thiết\", \"Gửi sản phẩm về trung tâm đổi trả hoặc cửa hàng gần nhất\", \"Xử lý và hoàn tất đổi trả trong 7 ngày làm việc\"], \"conditions\": {\"eligible\": [\"Sản phẩm còn nguyên tem, bao bì và không có dấu hiệu sử dụng\", \"Có hóa đơn mua hàng và phiếu bảo hành đi kèm\", \"Lỗi kỹ thuật do nhà sản xuất hoặc hư hỏng trong quá trình vận chuyển\"], \"ineligible\": [\"Sản phẩm đã qua sử dụng hoặc không còn nguyên trạng\", \"Không có hóa đơn mua hàng hoặc phiếu bảo hành\", \"Sản phẩm giảm giá hoặc khuyến mãi không áp dụng đổi trả\"]}, \"return_period\": \"15 ngày\"}}','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(3,'Chính sách vận chuyển và giao hàng','{\"shipping_policy\": {\"costs\": {\"express\": \"Phí 50.000 VNĐ\", \"standard\": \"Miễn phí với đơn hàng trên 1 triệu VNĐ\"}, \"notes\": [\"Khách hàng kiểm tra kỹ sản phẩm khi nhận hàng để tránh các trường hợp hư hỏng do vận chuyển\", \"Nếu sản phẩm có dấu hiệu hư hỏng, vui lòng từ chối nhận hàng và báo lại ngay cho chúng tôi\"], \"process\": [\"Xác nhận đơn hàng và chuẩn bị sản phẩm trong vòng 24 giờ\", \"Thông báo thời gian giao hàng và mã vận đơn qua email\", \"Theo dõi trạng thái đơn hàng qua hệ thống hoặc trang web đối tác vận chuyển\", \"Nhận hàng và kiểm tra tình trạng sản phẩm khi giao\"], \"shipping_time\": {\"express\": \"1-2 ngày làm việc\", \"standard\": \"3-5 ngày làm việc\"}}}','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(4,'Chính sách thanh toán','{\"payment_policy\": {\"methods\": [\"Thanh toán qua thẻ tín dụng/thẻ ghi nợ\", \"Chuyển khoản ngân hàng\", \"Thanh toán khi nhận hàng (COD)\"], \"guidelines\": {\"secure_payment\": \"Cam kết bảo mật thông tin thanh toán của khách hàng.\", \"payment_confirmation\": \"Xác nhận thanh toán sẽ được gửi qua email hoặc SMS.\"}, \"refund_process\": [\"Nếu khách hàng hủy đơn hàng trước khi giao, tiền sẽ được hoàn lại trong vòng 5-7 ngày làm việc.\", \"Đối với các đơn hàng đã nhận, hoàn tiền sẽ tuân theo chính sách đổi trả sản phẩm.\"]}}','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL),(5,'Chính sách bảo mật thông tin','{\"privacy_policy\": {\"data_usage\": [\"Thông tin của khách hàng chỉ được sử dụng trong các hoạt động liên quan đến giao dịch và chăm sóc khách hàng.\", \"Thông tin sẽ không được chia sẻ cho bên thứ ba mà không có sự đồng ý của khách hàng, trừ khi được yêu cầu bởi pháp luật.\"], \"data_collection\": [\"Chúng tôi thu thập thông tin cá nhân để xử lý đơn hàng và hỗ trợ khách hàng.\", \"Thông tin bao gồm họ tên, địa chỉ, số điện thoại, và email.\"], \"data_protection\": [\"Dữ liệu của khách hàng được bảo mật bằng công nghệ mã hóa SSL.\", \"Chúng tôi tuân thủ các quy định bảo mật dữ liệu để đảm bảo an toàn cho thông tin của khách hàng.\"]}}','2024-12-06 06:56:50','2024-12-06 06:56:50',NULL);
